import React from 'react'
import { Col, Row } from 'react-bootstrap'
import products from '../products'

const HomeScreen = () => {
	return (
		<div>
			<h1>Latest Products</h1>
			<Row>
				{products.map(product => (
					<Col sm={12} md={4} lg={3}>
						<h3>{product.name}</h3>
					</Col>
				))}
			</Row>
		</div>
	)
}

export default HomeScreen
